import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { InstalmentComponent } from 'app/payment/instalment/instalment.component';
import { InstalmentViewComponent } from 'app/payment/instalment/instalment-view/instalment-view.component';
import { InstalmentCreateComponent } from 'app/payment/instalment/instalment-create/instalment-create.component';
import { InstalmentApprovalComponent } from 'app/payment/instalment/instalment-approval/instalment-approval.component';
import {
  InstalmentTerminateApprovalComponent
} from 'app/payment/instalment/instalment-terminate-approval/instalment-terminate-approval.component';
import {
  InstalmentEditRejectedComponent
} from 'app/payment/instalment/instalment-edit-rejected/instalment-edit-rejected.component';

const routes: Routes = [
  {
    path: '',
    component: InstalmentComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'create/:nric',
    component: InstalmentCreateComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: ':instalmentId',
    component: InstalmentViewComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'approve/:id',
    component: InstalmentApprovalComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'terminate/approve/:instalmentId',
    component: InstalmentTerminateApprovalComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'rejected/edit/:instalmentId',
    component: InstalmentEditRejectedComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  }
];


@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})


export class InstalmentRoutingModule {
}
